import './App.css';

function App() {
  let kursy = ["Programowanie w C#", "Angular dla początkujących", "Kurs Django"];
  return (
    <div className="App">
      <h2>Liczba kursów: {kursy.length}</h2>
      <ul>
      {kursy.map((kurs) => <li>{kurs}</li>)}
      </ul>
    </div>
  );
}

export default App;
